import React from "react"
import styles from "./CSS/MemberCard.module.css"

class MemberCard extends React.Component {

    handleChange(event) {
        this.props.initiative = event.target.value;
    }

    render(){
        return(
            <div className={styles.MemberCardContainer}>
                <div className={styles.Title}>
                    <p className={styles.Name}>{this.props.name}</p>
                    <input className={styles.InitiativeField} type="number" value={this.props.initiative}/>
                </div>
            </div>
        );
    }
}

export default MemberCard;
